    """Finds the solution to the 8-queens puzzle

    Args:
        stdin (str): The input of the problem

    Returns:
        str: The solution to the problem
    """
    # Parse the input
    n = int(stdin.split("\n")[0])
    positions = [[int(x) for x in line.split(" ")] for line in stdin.split("\n")[1:]]
    # Check the number of queens in the solution
    if not n or n <= 0:
        return "INCORRECT"
    # Check the number of queens in the solution
    if n < len(positions):
        return "INCORRECT"
    # Check if each queen is in a valid position
    for pos in positions:
        if not (0 <= pos[0] < n and 0 <= pos[1] < n):
            return "INCORRECT"
    # Check if there are any queens that can attack each other
    for pos in positions:
        for other_pos in positions:
            if pos == other_pos:
                continue
            if pos[0] == other_pos[0] or pos[1] == other_pos[1] or abs(pos[0] - other_pos[0]) == abs(pos[1] - other_pos[1]):
                return "INCORRECT"
    return "CORRECT"

